              />
              <Icon
                className={clsx(classes4.icon, "fa fa-plus-circle")}
                color="disabled"
                fontSize="large"
              />
            </div>
          </KTCodeExample>
        </div>
        <div className="col-md-6">
          <KTCodeExample jsCode={jsCode2} beforeCodeTitle="Usage">
            <span>
