              </Grid>
              <Grid item xs={8}>
                <DeleteRoundedIcon className={classes2.icon} />
                <DeleteForeverRoundedIcon className={classes2.icon} />
              </Grid>
              <Grid item xs={4}>
                <Typography>Two Tone</Typography>
              </Grid>
              <Grid item xs={8}>
